  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0105859 includes chemical,
  discrete sample, physical and profile data collected from G.O. SARS in the North
  Greenland Sea and Norwegian Sea from 2006-07-21 to 2006-08-05 and retrieved during
  cruise 58GS20060721 (gs2006111). These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect
  these data include Alkalinity titrator, CTD, Coulometer for DIC measurement and
  bottle. These data were collected by A. Olsen of University of Bergen; Bjerknes
  Center for Climate Research; Geophysical Institute as part of the CLIVAR_75N_2006
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
